import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Container from './components/Container';

function App() {

  const label = "About Me"
  return (
    <div className="App">
      <Navbar />
      <Container containerLabel={label}/>
    </div>
  );
}

export default App;
